import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const App = () => {
  return (
    <>
      <div className=" container ">
        <h1 className="text-center  ">Welcome</h1>
        <button type="button" class="btn btn-success">
          Success
        </button>
      </div>
    </>
  );
};

export default App;
